import React from "react";
import { Layout, Button } from "antd";
import chart from "./dashchart";

const Dashboard = () => (
  <>
    <Layout style={{ margin: 20, background: "white" }}>
      <section>
        <Button size="large" type="primary" href="/addtrade">
          Add trade
        </Button>
      </section>
      <section>
        <chart />
      </section>
    </Layout>
  </>
);

export default Dashboard;
